import ExpenseItem from "./ExpenseItem";
import App from '../App'

function Expenses(props) {

return(
    <div>
    <ExpenseItem
      title={props.expenses[0].title}
      amount={props.expenses[0].amount}
      date={props.App.expenses[0].date}
    ></ExpenseItem>
    <ExpenseItem
      title={props.App.expenses[1].title}
      amount={props.App.expenses[1].amount}
      date={props.App.expenses[1].date}
    ></ExpenseItem>
    <ExpenseItem
      title={props.App.expenses[2].title}
      amount={props.App.expenses[2].amount}
      date={props.App.expenses[2].date}
    ></ExpenseItem>
    <ExpenseItem
      title={props.App.expenses[3].title}
      amount={props.App.expenses[3].amount}
      date={props.App.expenses[3].date}
    ></ExpenseItem>
  </div>
)
}



export default Expenses
